import React, { useState } from "react";
import ReactDOM from "react-dom";
import "antd/dist/antd.css";
import "./index.css";
import {
  Form,
  Input,
  Select,
  InputNumber,
  Checkbox,
  Button,
  Layout,
  Space,
  message,
  Alert
} from "antd";
const { Option } = Select;


const { Content, Footer } = Layout;
const Webform = () => {
  const [componentSize, setComponentSize] = useState("default");
  const [ConformationText, setConformationText] = useState(false );
  const [setCheckboxs] = useState(true);
  
  const onFormLayoutChange = ({ size }) => {
    setComponentSize(size);
  };
  const onFinish = values => {
    console.log('Success:', values);
    setConformationText(true);
  };

  const onFinishFailed = errorInfo => {
    console.log('Failed:', errorInfo);
  };
  const dropdownHandler = value => {
     console.log(value);
     setCheckboxs(true);
  // };
  // const setCheckboxs = value => {
    
    
  // };

  return (
   <Layout style ={{backgroundColor:"black"}}>
    <Content 
      className="site-layout"
      style={{backgroundColor:"white",padding: "30px", margin: 64,textAlign:"center" }}
    >
      
      <Space align="center">
      <Form style={{ContentAlign:"left"}}
        labelCol={{
          span: 14
        }}
        wrapperCol={{
          span: 14
        }}
      
         initialValues={{
           size: componentSize
         }}
        onValuesChange={onFormLayoutChange}
         size={componentSize}
        
         onFinish={onFinish}
         onFinishFailed={onFinishFailed}

      >
       
        <Form.Item label="Name of the Object " name="Name of the Object" rules={[

          {
            required:true,
            message:'Please input the name!',
          }
        ]}>
          <Input />
        </Form.Item>
        
        <Form.Item label="Shape" name="Shape" rules={[
          {
            required: true,
            message: 'Please select the shape!',
          },
        ]}
>

          <Select 
           mode="multiple"
           onChange={dropdownHandler}
          >
            
            <Option id = "sphere" value="sphere">Sphere</Option>
            <Option id = "cube" value="cube">Cube</Option>
            <Option id = "cuboid" value="cuboid">Cuboid</Option>
            <Option id = "cone" value="cone">Cone</Option>
            
          </Select>
        </Form.Item >

        <Form.Item label="Dimensions:X" name="Dimension:X" rules={[
          {
            required: true,
            message: 'Please input dimension x',
          },
        ]}>
          <Input />   
        </Form.Item>
        
        <Form.Item label="Dimensions:Y" name="Dimension:Y" rules={[
          {
            required: true,
            message: 'Please input dimension y!',
          },
        ]}>
          <Input />   
        </Form.Item>
        
        <Form.Item label="Dimensions:Z" name="Dimension:Z" rules={[
          {
            required: true,
            message: 'Please input dimension z!',
          },
        ]}>
          <Input />   
        </Form.Item>
        
        <Form.Item label="Colour" name = "Colour"rules={[
          {
            required: true,
            message: 'Please input colour!',
          },
        ]}>
          <Select>
            <Select.Option value ="red">Red</Select.Option>
            <Select.Option value ="green">Green</Select.Option>
            <Select.Option value ="yellow">Yellow</Select.Option>
            <Select.Option value ="blue">Blue</Select.Option>
           <Select.Option value = "orange">Orange</Select.Option>
          </Select>
        </Form.Item>
        
        <Form.Item label="Position" name="Position" rules={[
          {
            required: true,
            message: 'Please input position!',
          },
        ]}>
          <Input />
        </Form.Item>
       
     
        <Form.Item label="Render Object" >
          <Checkbox></Checkbox>
        </Form.Item>
       
        <Form.Item style={{marginLeft:212}} >
          <Button type = "primary" htmlType= "submit">Render</Button>
        </Form.Item>
 
        
      </Form>
      </Space>
     {ConformationText? <Alert message="Success Text" type="success" />:null}
    </Content>
  </Layout>
           
  );
 };
}
export default Webform;
